package com.bs.xyplibs.utils;import android.text.TextUtils;import java.util.Map;public class PayResult {    private String resultStatus;    private String result;    private String memo;    private String appid;    private String noncestr;    private String pkg;    private String partnerid;    private String prepayid;    private String timestamp;    private String sign;    private PayResult wxpay_param;    private PayResult datas;    private PayResult data;    public PayResult(Map<String, String> rawResult) {        if (rawResult == null) {            return;        }        for (String key : rawResult.keySet()) {            if (TextUtils.equals(key, "resultStatus")) {                resultStatus = rawResult.get(key);            } else if (TextUtils.equals(key, "result")) {                result = rawResult.get(key);            } else if (TextUtils.equals(key, "memo")) {                memo = rawResult.get(key);            }        }    }    @Override    public String toString() {        return "resultStatus={" + resultStatus + "};memo={" + memo                + "};result={" + result + "}";    }    /**     * @return the resultStatus     */    public String getResultStatus() {        return resultStatus;    }    /**     * @return the memo     */    public String getMemo() {        return memo;    }    /**     * @return the result     */    public String getResult() {        return result;    }    public void setResultStatus(String resultStatus) {        this.resultStatus = resultStatus;    }    public void setResult(String result) {        this.result = result;    }    public void setMemo(String memo) {        this.memo = memo;    }    public String getAppid() {        return appid;    }    public void setAppid(String appid) {        this.appid = appid;    }    public String getNoncestr() {        return noncestr;    }    public void setNoncestr(String noncestr) {        this.noncestr = noncestr;    }    public String getPkg() {        return pkg;    }    public void setPkg(String pkg) {        this.pkg = pkg;    }    public String getPartnerid() {        return partnerid;    }    public void setPartnerid(String partnerid) {        this.partnerid = partnerid;    }    public String getPrepayid() {        return prepayid;    }    public void setPrepayid(String prepayid) {        this.prepayid = prepayid;    }    public String getTimestamp() {        return timestamp;    }    public void setTimestamp(String timestamp) {        this.timestamp = timestamp;    }    public String getSign() {        return sign;    }    public void setSign(String sign) {        this.sign = sign;    }    public PayResult getWxpay_param() {        return wxpay_param;    }    public void setWxpay_param(PayResult wxpay_param) {        this.wxpay_param = wxpay_param;    }    public PayResult getDatas() {        return datas;    }    public void setDatas(PayResult datas) {        this.datas = datas;    }    public PayResult getData() {        return data;    }    public void setData(PayResult data) {        this.data = data;    }}